import React from "react";

import Head from 'next/head'
import Logo from '../glug.png'

import Navbar from '../components/Navbar'
import Footer from '../components/Footer'

import GoogleLog3 from '../components/GoogleLog3'
import FbLog2 from '../components/FbLog2'
import Particles from "react-particles-js";

function index() {


    return (
        <div>
            <style jsx>{`
                div {
                text-align: center;
                content-align: center;
                margin: 0px auto;
                }
            `}</style>

        <Particles
                params={{
                particles: {
                    number: {
                    value: 200,
                    density: {
                        enable: true,
                        value_area: 900,
                    },
                    },
                    color: {
                    value: ["#cc0000"],
                    },
                    line_linked: {
                    color: "#aa0044",
                    opacity: 1,
                    },
                },
                }}
                style={{
                width: "100%",
                height: "100%",
                top: 0,
                left: 0,
                position: "fixed",
                index: "-10",
                }}
            />
            <div>

                <div>
                    <Head>
                        <meta charset="UTF-8" />
                        <meta name="viewport" content="width=device-width, initial-scale=1.0, shrink-to-fit:no" />
                        <title>Screencast </title>
                        <link rel="stylesheet" type="text/css" href="question.css" />
                    </Head>
                </div>

                <Navbar/>

                <div style={{
                        marginRight: "auto", marginLeft: "auto", textAlign: "center", marginTop: "70px"
                    }}>
                        <img src={Logo} alt="logo" style={{ position: "relative", float: "bottom", height: "120px", width: "auto" }} />

                    </div>

                    <div>
                        <div 
                        className="sign"
                        style={{ marginTop: "20px", marginBottom: "20px" }}
                        >
                            <span className="fast-flicker">screen</span>cast{" "}
                            <span className="flicker">2020 </span>
                        </div>
                        <div className="login-head" style={{ marginBottom: "20px" }}>
                            <h1>Login to play </h1>
                        </div>
                </div>


                <GoogleLog3 />
                <FbLog2/>
                </div>

                <Footer/>



         </div>
    )
}

export default index
